    $url = "https://api.telegram.org/bot" . $tg_haypi . "/sendMessage?chat_id=" . $tg_ceid . "&parse_mode=Markdown&text=". urlencode($msg_txt);
    $ch = curl_init(); 
    curl_setopt($ch, CURLOPT_URL, $url);
    curl_setopt($ch, CURLOPT_RETURNTRANSFER, 1);
    curl_setopt($ch, CURLOPT_SSL_VERIFYPEER, 0);
